import React, { Component } from 'react';
import Main from './main';

//import picture
import bill_ from "../picture/billbord.JPG";
import my_push from "./picture/push.JPG";
import my_apil from "./picture/apill.JPG";

class Crds extends Component {
    constructor(){
        super()
        this.picture=[{id:1 , image:bill_},{id:2 , image:my_push},{id:3 , image:my_apil}]
        
      }
    render() {
        return (
            <>
            {this.picture.map((p)=><Main picture={p.image} key={p.id} />)}
            </>
        );
    }
}

export default Crds;
